import * as react from 'react';
import {
  Typography,
  Stack,
  Button,
  Card,
  CardContent,
  CardHeader,
  Divider,
  Box,
  Grid,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

export default function Dashboard(): React.ReactElement {
  const navigate = useNavigate();
  return (
    <Box
      sx={{ display: 'flex', direction: 'Column', gap: 2, flex: 1, minHeight: 0, bgcolor: 'white' }}
    >
      <Stack direction="row" alignItems="center" spacing={1}>
        <Typography variant="h6" sx={{ flex: 1 }}>
          Overview
        </Typography>
        <Button variant="contained" sx={{ boxShadow: 'none' }} onClick={() => navigate('/live')}>
          Go live
        </Button>
      </Stack>
    </Box>
  );
}
